import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Nav from "./components/Navbar";

function App() {
	return (
		<div className="App">
			<BrowserRouter>
				<div>
					<Navigation />
					<Routes>
						<Route path="/" element={<Home />} />
						<Route path="/data" element={<DataTable />} />
						<Route path="/chart" element={<Chart />} />
					</Routes>
				</div>
			</BrowserRouter>
			<Nav></Nav>
		</div>
	);
}

export default App;
